овичу Громыко за ведение беременности и ответы даже на самые мои невероятные вопросы, за то, что всегда находили слова, для того, чтобы меня успокоить, за доброе отношение. Спасибо замечательным эмбриологам за золотые руки и знание своего дела, к сожалению, я не знаю точно кто работал с нашим биоматериалом, но уверенна, что все вы являетесь профессионалами с большой буквы. Отдельная благодарность девушкам на ресепшен, которые всегда отзывчиво относились к моим просьбам и организовывали приемы максимально удобно, особенная благодарность Арине. Каждому из Вас желаю крепкого здоровья, благополучия, максимальной отдачи от работы и море благодарных пациентов! Центру - только развития и процветания!";s:4:"TYPE";s:4:"TEXT";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"52623:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"52623:26";s:24:"PROPERTY_LAST_NAME_VALUE";s:16:"Яковлева";s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"52623:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"52623:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";i:0;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"52623:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:51917;a:24:{s:2:"ID";s:5:"51917";s:11:"ACTIVE_FROM";s:15:"1 июня 2022";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:12:"Марина";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"51917:21";s:20:"PROPERTY_EMAIL_VALUE";s:28:"Marinochka7777779@gmail.com ";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"51917:22";s:25:"PROPERTY_SPECIALIST_VALUE";i:25;s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"51917:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:443:"Большое спасибо Радионовой Виктории Вадимовне! Благодаря Вашей работе я стала мамой. Выбрав нового врача я не прогадала. Была у вас в сентябре и вот 25 мая у нас родилась замечательная дочурка. Успехов Вам в работе и положительных результатов! ";s:4:"TYPE";s:4:"TEXT";}s: